    false,nt"url": null,nt"notes": "Biomass carbon includes carbon stored in
    above- and below-ground live plant components (such as leaf, branch, stem and root)
    as well as in standing and down dead woody debris, and fine litter. The data of
    this variable were generated by the USGS LandCarbon project using the General Ensemble
    Biogeochemical Modeling System (GEMS) based on selected IPCC emissions scenarios,
    biogeochemical models, and climate datasets. The spatial extent is the conterminous
    United States and the temporal extent is from 1992 through 2050. These data are
    projected to Albers Equal Area in the NAD83 datum at a resolution of 2000 meters
    and are spatially gridded in GeoTiff format. Units of measure are expressed in g
    Carbon/m2.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
